import React, { Component } from "react";
class About extends Component {
  render() {
    return (
      <div className="aboutMain">
        <p>
          CHLELA is a software development team in San Francisco, California
          <br />
          We deploy a combination of highly experienced, highly skilled
          engineers in the US and remotely to deliver an affordable high quality
          software.
        </p>
      </div>
    );
  }
}

export default About;
